    function GetRandomWords($min, $max) {
        $words = [
            "provider", "external", "eternal", "image", "video", "vm", "line", "pipe", "to",
            "python", "php", "javascript", "js", "_", "request", "poll", "secure", "http",
            "packet", "low", "geo", "cpu", "update", "process", "processor", "auth", "game",
            "longpoll", "api", "bigload", "server", "multi", "protect", "default", "sql",
            "db", "base", "linux", "windows", "flower", "async", "generator", "traffic", "test",
            "universal", "track", "wordpress", "datalife", "wp", "dle", "local", "public",
            "private", "temp", "cdn", "central", "uploads", "downloads", "temporary"
        ];
        $result = "";
        $randomWords = array_rand($words, random_int($min, $max));
        foreach ($randomWords as $word) {
            $result .= (random_int(0, 1) == 1 ? ucfirst($words[$word]) : $words[$word]);
        }
        return $result;
    }
    
    function genCCT($length = 256) {
        $digits = '';
        for ($i = 0; $i < $length; $i++) {
            $digits .= rand(0, 9);
        }
        return $digits;
    }
    
    function genSalt() {
        $randomString = bin2hex(random_bytes(16));
        $sha1Hash = sha1($randomString);
        return $sha1Hash;
    }
    
    function hashStrings($pass, $salt) {
        $md5Hash = md5($pass);
        $combinedString = $md5Hash . $salt;
        $sha1Hash = sha1($combinedString);
        return $sha1Hash;
    }
    
    function cfile_put_contents644($path, $content) {
        file_put_contents($path, $content);
        chmod($path, 0644);
    }
    
    function xorLink($array1, $array2) {
        if (strlen($array1) != strlen($array2)) {
            echo "lox";
            //throw new InvalidArgumentException("Arrays must be of the same length.");
        }

        $xorResult = '';

        for ($i = 0; $i < strlen($array1); $i++) {
            $xorResult .= sprintf("%02x", ord($array1[$i]) ^ ord($array2[$i]));
        }

        return $xorResult;
    }

